import React from "react";
import Input from "../../UI/Input"
import classes from "./MealItemForm.module.css";
const ModuleItemForm=(props)=>{
return(
    <form className={classes.form}>
        <Input label="Amount" input={{
            type:'number',
            id:'amount',
            min:'1',
            max:'5',
            defaultValue:'1'
        }}/>
        <button>+ Add</button>
    </form>
)
}

export default ModuleItemForm;
